import React from 'react';
import ArticlesList from './ArticlesList';
import ArticlesSortedBy from './ArticlesSortedBy';

const Articles = () => {
	return (
		<main>
			<h2>Todays top articles:</h2>
			<ul>
				<ArticlesList />
			</ul>
			<br />
		</main>
	);
};

export default Articles;
